    "get_project_timer_value_exampleDesc": "[시작하기]버튼을 클릭하면 초시계를 시작합니다. 3초 뒤에는 초시계를 정지하고 초시계창을 숨깁니다. 그 후 초시계값을 말합니다.",
    "choose_project_timer_action_desc": "초시계의 동작을 A로 정합니다.<br>(이 명령어를 사용하면 실행화면에 ‘초시계 창’이 생성됩니다.)",
