    "get_canvas_input_value_exampleDesc": "[시작하기]버튼을 클릭하면 오브젝트가 \"이름을 입력해보세요.\"라고 말풍선으로 묻습니다. 이름을 입력하면 \"(입력한 이름) 반가워!\"라 말합니다.",
