    "change_value_list_index_elements": "A-- 리스트명<br>① 모든 오브젝트에서 사용: A<br>② 이 오브젝트에서 사용: self.A%nextB-- 리스트 항목의 위치%nextC-- 리스트에 넣을 항목 값<br>① 문자 : \"안녕!\", \"엔트리\" 등 <br>② 숫자 : 0, 10, 35 등",
